import './navigation';
import './notification';
import './lazyLoad';
import './textBracket';
// import './animation'
// import './examples'
import './contacts';

// import './http'
particlesJS('particles-js', {
	particles: {
		number: {
			value: 40,
			density: {
				enable: true,
				value_area: 500
			}
		},
		color: {
			value: '#59DBD5'
		},
		shape: {
			type: 'circle',
			stroke: {
				width: 0,
				color: '#505050'
			},
			polygon: {
				nb_sides: 5
			},
			image: {
				src: 'img/github.svg',
				width: 100,
				height: 100
			}
		},
		opacity: {
			value: 0.5,
			random: false,
			anim: {
				enable: false,
				speed: 1,
				opacity_min: 0.1,
				sync: false
			}
		},
		size: {
			value: 3,
			random: true,
			anim: {
				enable: false,
				speed: 40,
				size_min: 0.1,
				sync: false
			}
		},
		line_linked: {
			enable: true,
			distance: 150,
			color: '#505050',
			opacity: 0.4,
			width: 1
		},
		move: {
			enable: true,
			speed: 6,
			direction: 'none',
			random: false,
			straight: false,
			out_mode: 'out',
			bounce: false,
			attract: {
				enable: true,
				rotateX: 600,
				rotateY: 1200
			}
		}
	},
	interactivity: {
		detect_on: 'canvas',
		events: {
			onhover: {
				enable: true,
				mode: 'grab'
			},
			onclick: {
				enable: true,
				mode: 'push'
			},
			resize: true
		},
		modes: {
			grab: {
				distance: 140,
				line_linked: {
					opacity: 1
				}
			},
			bubble: {
				distance: 400,
				size: 40,
				duration: 2,
				opacity: 8,
				speed: 3
			},
			repulse: {
				distance: 200,
				duration: 0.4
			},
			push: {
				particles_nb: 4
			},
			remove: {
				particles_nb: 2
			}
		}
	},
	retina_detect: true
});
// bracket text

// lazy loading

const animationHandler = class {
	constructor({ selectors }) {
		this.selectors = selectors;
		this.handle();
	}

	handle() {
		this.selectors.forEach(selector => {
			const { animate, start } = selector.dataset;
			switch (start) {
				case 'load':
					document.addEventListener('DOMContentLoaded', () => {
						selector.classList.add(animate);
					});
				case 'scroll':
					window.addEventListener('scroll', () =>
						this.checkScroll(selector, animate)
					);
					this.checkScroll(selector, animate);
					break;

				default:
					break;
			}
		});
	}

	checkScroll(selector, animate) {
		if (
			selector.getBoundingClientRect().top <=
			document.documentElement.clientHeight
		) {
			selector.classList.add(animate);
		}
	}
};
document.addEventListener('DOMContentLoaded', () => {
	new animationHandler({
		selectors: [...document.querySelectorAll('.animated')]
	});
});
